import ExpenseItem from './ExpenseItem.js';

function Expense(props) {
  return (
      <div>
        <ExpenseItem title={props.items[0].title} date={props.items[0].date} amount={props.items[0].amount}/>
        <ExpenseItem title={props.items[0].title} date={props.items[0].date} amount={props.items[0].amount}/>
      </div>
  );
}

export default Expense;
